import React, { Component } from 'react';
import Select from 'react-select';

const tempOptions = [
  { label: "Any", value: 0 },
  { label: "Aerospace", value: 1 },
  { label: "Aquarium Science", value: 2 },
  { label: "Beekeeping", value: 3 },
  { label: "Project Management", value: 4 },
  { label: "Software Engineering", value: 5 },
];

const sortOptions = [
  { label: "Deadline (Earliest)", value: 0 },
  { label: "Deadline (Lastest)", value: 1 },
  { label: "Popularity", value: 2 },
];

export default class Filter extends Component {
  state = {
  }

  render () {
      return (
        <div>
           <label className="filter-label">Industry</label>
           <Select
             options={tempOptions}
             className="filter-dropdown"
             defaultValue={tempOptions[0]}
             theme={theme => ({
              ...theme,
              borderRadius: "8px",
              colors: {
                ...theme.colors,
                primary25: '#eeeeee',
                primary: '#3d5afe',
                primary50: '#e8e8e8',
              },
            })}>
          </Select>
          <label className="filter-label">Deadline</label>
          <Select
            options={tempOptions}
            className="filter-dropdown"
            defaultValue={tempOptions[0]}
            theme={theme => ({
             ...theme,
             borderRadius: "8px",
             colors: {
               ...theme.colors,
               primary25: '#eeeeee',
               primary: '#3d5afe',
               primary50: '#e8e8e8',
             },
           })}>
         </Select>
          <br></br>
          <input id="paidSelector" type="checkbox" /><label for="paidSelector"> Paid</label>
        </div>
      )
   }
}
